import 'bootstrap/dist/css/bootstrap.css';
import React,{Component} from 'react';
import './App.css';

export default class Navbar extends Component{
	constructor(){
        super()
    }

    render(){
        return (
            <nav class="navbar navbar-expand-lg navbar" style={{backgroundColor: "black"}} >
                <a class="navbar-brand" href="#" style={{color: "white"}}>QA Cinema</a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>

                <div class="collapse navbar-collapse" id="navbarSupportedContent" style={{color: "white"}}>
                    <ul class="navbar-nav mr-auto">
                        <li class="nav-item active">
                            <a class="nav-link" href="#" style={{color: "white"}}><strong>Info</strong><span class="sr-only">(current)</span></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#" style={{color: "white"}}>Contact Us</a>
                        </li>
                    </ul>
                    <form class="form-inline my-2 my-lg-0">
                        <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"/>
                        <button class="btn btn-outline-info my-2 my-sm-0" type="submit">Search</button>
                    </form>
                </div>
            </nav>
        )
    }   
}
